function foxTarget = computeFoxTarget(rabbitPos, foxPos, warehouseNW, warehouseSW)  Y = 2; # index of y coordinate  X = 1; # index of x coordinate    if (isLineOfSight(foxPos, rabbitPos, warehouseNW, warehouseSW))    foxTarget = rabbitPos;    return;  end  % bug here consider fox being above warehouse when it loses line of sight  if (foxPos(Y) < warehouseSW(Y))        foxTarget = warehouseSW;  elseif (distance(rabbitPos, warehouseNW) < distance(rabbitPos, warehouseSW))    foxTarget = warehouseNW;  else    foxTarget = warehouseSW;  endif end